import React from "react";
import SwordTooltip from "./GamesComponents/SwordTooltip";

export default class Games extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      games: [
        {
          id: 0,
          name: "Game Name",
          notes: "Game Notes",
          finalround: 10,
          winner: 0,
          year: 2019,
          month: 6,
          day: 11,
          lannister: 1,
          greyjoy: 3,
          stark: -1,
          arryn: -1,
          baratheon: 2,
          targaryen: -2,
          dorn: 0,
          tyrell: 4
        }
      ],
      players: [],
      mouseOver: false,
      mouseOverTarget: 0,
      mouseX: 0,
      mouseY: 0
    };

