  componentDidMount() {
    fetch("/getGames")
      .then(response => {
        console.log("App fetching: " + JSON.stringify(response));
        return response.json();
      })
      .then(data => this.setState({ games: data }));

    fetch("/getPlayers")
      .then(response => {
        console.log("App fetching: " + JSON.stringify(response));
        return response.json();
      })
      .then(data => this.setState({ players: data }));
