          return "Stark";
        } else if (this.state.games[i].arryn === idIn) {
          return "Arryn";
        } else if (this.state.games[i].baratheon === idIn) {
          return "Baratheon";
        } else if (this.state.games[i].targaryen === idIn) {
          return "Targaryen";
        } else if (this.state.games[i].dorn === idIn) {
          return "Dorne";
        } else if (this.state.games[i].tyrell === idIn) {
          return "Tyrell";
        } else {
          return "No House";
        }
      }
    }
