        forcedMuster: 0,
        playerNotes: "Targaryen can't be a vassal."
      },
      dorn: {
        throne: 7,
        sword: 7,
        raven: 7,
        money: 0,
        supply: 4,
        boats_start: 3,
        footmen_start: 4,
